window.bookSummaryJSON = "<p>Oberon Blackphoenix almost united all the races on his part of the world. It would have meant a term of peace yet unheard of. Sadly, he was betrayed by one of his most trusted advisors. With his once friend's sword piercing his chest, he cast his last spell.&nbsp;</p> <p>Unintended by even him, his spell incorporates a legendary item that results in the world being cursed. Now over a thousand years later, a certain sorcerer once again wakes...and he is not happy. Alessa has been on the run for years. Never stopping in one place for long. When she arrives at a place where the secret that has haunted her the span of her short life, it might just be the one thing that lets her survive.&nbsp;</p> <p>Will she be able to handle the consequences that result from this meeting?</p>"; 
